SELECT COUNT(*) as agg_0, MIN("lineorder"."lo_extendedprice" + "lineorder"."lo_partkey") as agg_1, AVG("dim_date"."d_daynuminyear" + "supplier"."s_suppkey") as agg_2 FROM "customer" LEFT OUTER JOIN "lineorder" ON "customer"."c_custkey" = "lineorder"."lo_custkey" LEFT OUTER JOIN "dim_date" ON "lineorder"."lo_orderdate" = "dim_date"."d_datekey" LEFT OUTER JOIN "supplier" ON "lineorder"."lo_suppkey" = "supplier"."s_suppkey"  WHERE "lineorder"."lo_suppkey" BETWEEN 1635 AND 2843 AND "dim_date"."d_date" NOT LIKE '%16,%'